import React from 'react';

const coinsData = [
  { name: 'BTC', price: 20000, change: 'GREEN' },
  { name: 'ETH', price: 200, change: 'RED' },
];

function Coin({ name, price, change }) {
  return (
    <div style={{ display: 'flex', justifyContent: 'space-between' }}>
      <div>{name}</div>
      <div>{price}</div>
      <div style={{ color: change }}>{change}</div>
    </div>
  );
}

export default function CoinList() {
  return (
    <div>
      <h3 style={{ textAlign: 'center' }}># NAME PRICE 1D</h3>
      {coinsData.map((coin, index) => (
        <Coin key={index} {...coin} />
      ))}
    </div>
  );
}
